INSERT INTO `v1_419e5e925b4739d75fb4a53bd696f973062ebbc3509347ba394b5b0626bbd34c` VALUES (0.0, 0, 24, 1, "2020/04/30 12:00:00", 0.0, 10040, 102601, "あたしだって\nやるときはやるよ！", 1, "2030/12/17 14:59:59", 24001, 0.0, "リン");
INSERT INTO `v1_419e5e925b4739d75fb4a53bd696f973062ebbc3509347ba394b5b0626bbd34c` VALUES (0.0, 1, 24, 1, "2020/04/30 12:00:00", 0.0, 10040, 102601, "ふぅ…\nこれであたしの仕事は\n終わりだね", 1, "2030/12/17 14:59:59", 24002, 0.0, "リン");
INSERT INTO `v1_419e5e925b4739d75fb4a53bd696f973062ebbc3509347ba394b5b0626bbd34c` VALUES (0.0, 2, 24, 1, "2020/04/30 12:00:00", 0.0, 10040, 102601, "終わった終わった\n一人でもなんとか\nなるもんだね", 1, "2030/12/17 14:59:59", 24003, 0.0, "リン");
INSERT INTO `v1_419e5e925b4739d75fb4a53bd696f973062ebbc3509347ba394b5b0626bbd34c` VALUES (0.0, 3, 24, 2, "2020/04/30 12:00:00", 0.0, 10040, 102601, "やったね！\nこれでようやく\nサボれるよ…", 2, "2030/12/17 14:59:59", 24004, 0.0, "リン");
INSERT INTO `v1_419e5e925b4739d75fb4a53bd696f973062ebbc3509347ba394b5b0626bbd34c` VALUES (0.0, 4, 24, 1, "2020/04/30 12:00:00", 0.0, 10040, 102601, "チーズが欲しいなら\nきちんと働いて\n買いに来なよ", 1, "2030/12/17 14:59:59", 24005, 0.0, "リン");
INSERT INTO `v1_419e5e925b4739d75fb4a53bd696f973062ebbc3509347ba394b5b0626bbd34c` VALUES (0.0, 5, 24, 2, "2020/04/30 12:00:00", 0.0, 10040, 102601, "あたしを敵に回した\n恐ろしさ\n思い知ったか！", 2, "2030/12/17 14:59:59", 24006, 0.0, "リン");
INSERT INTO `v1_419e5e925b4739d75fb4a53bd696f973062ebbc3509347ba394b5b0626bbd34c` VALUES (0.0, 6, 24, 2, "2020/04/30 12:00:00", 0.0, 10040, 102601, "あたしも意外と\nやるもんでしょ？", 2, "2030/12/17 14:59:59", 24007, 0.0, "リン");
INSERT INTO `v1_419e5e925b4739d75fb4a53bd696f973062ebbc3509347ba394b5b0626bbd34c` VALUES (0.0, 7, 24, 4, "2020/04/30 12:00:00", 0.0, 10040, 102601, "疲れた…\nねずみの逃げ足\n速すぎるよ…", 4, "2030/12/17 14:59:59", 24008, 0.0, "リン");
INSERT INTO `v1_419e5e925b4739d75fb4a53bd696f973062ebbc3509347ba394b5b0626bbd34c` VALUES (0.0, 8, 24, 4, "2020/04/30 12:00:00", 0.0, 10040, 102601, "このままじゃ\nまっひ～に\n叱られちゃうよ", 4, "2030/12/17 14:59:59", 24009, 0.0, "リン");
INSERT INTO `v1_419e5e925b4739d75fb4a53bd696f973062ebbc3509347ba394b5b0626bbd34c` VALUES (0.0, 9, 24, 4, "2020/04/30 12:00:00", 0.0, 10040, 102601, "まじめに\nやったんだけどな…\n悔しいな～", 4, "2030/12/17 14:59:59", 24010, 0.0, "リン");
INSERT INTO `v1_419e5e925b4739d75fb4a53bd696f973062ebbc3509347ba394b5b0626bbd34c` VALUES (0.0, 10, 24, 4, "2020/04/30 12:00:00", 0.0, 10040, 102601, "やられた…\nねずみって意外と\nてごわいね", 4, "2030/12/17 14:59:59", 24011, 0.0, "リン");
INSERT INTO `v1_419e5e925b4739d75fb4a53bd696f973062ebbc3509347ba394b5b0626bbd34c` VALUES (0.0, 11, 24, 4, "2020/04/30 12:00:00", 0.0, 10040, 102601, "おのれ～\nあたしのチーズを\n盗みやがって～！", 4, "2030/12/17 14:59:59", 24012, 0.0, "リン");
INSERT INTO `v1_419e5e925b4739d75fb4a53bd696f973062ebbc3509347ba394b5b0626bbd34c` VALUES (0.0, 12, 24, 1, "2020/04/30 12:00:00", 0.0, 10040, 102601, "疲れた…\nけど、次こそは\n守り抜くよ…", 4, "2030/12/17 14:59:59", 24013, 1.81, "リン");
